import React, {Component} from 'react';
import './ProcessRender.css';

const process_name = ["Raw Material", "Roasted Beans", "Winnowed Beans", "Ground Beans", "Chocolate Bars", "Cocoa Powder"];
const process_list = process_name.map((name => (
  <div className={`process_name ${name}`} >{name}</div>
)))

class ProcessRender extends Component {
  render() {
    return (
      <div className="process outer-container">
        <div className="page-title">Production Process</div>
        <div className="process-container">
          {process_list}
        </div>
        <div className="process-container">
          {process_list}
        </div>

      </div>

    );
  }
}

export default ProcessRender;
